import React from "react";
import HeroSelection from "./HeroSelection"
import RecruitList from "./RecruitList"



function Home({ isLoadedHeroes, heroArray, displayArray, heroSelectionArray, onAddToTeamBtnClick, onDisselectBtnClickInSelection, heroArrayParse, setHeroArrayParse, currentTeam, nasaImage }) {


  return (
    <div className="HomeContainer">
      {
        heroSelectionArray.length === 0 ?
        <h1 className="home-h2">Please start selecting your heroes </h1>
        :



        <HeroSelection heroSelectionArray={heroSelectionArray}
                       onAddToTeamBtnClick={onAddToTeamBtnClick}
                       onDisselectBtnClickInSelection={onDisselectBtnClickInSelection}
                       currentTeam={currentTeam}

                        />

      }

        <RecruitList isLoadedHeroes={isLoadedHeroes} heroArray={heroArray} heroArrayParse={heroArrayParse} setHeroArrayParse={setHeroArrayParse} nasaImage={nasaImage}/>

    </div>
  );
}

export default Home;
